export function ensureArray(t) {
    return t == null ? [] : Array.isArray(t) ? [...t] : [t];
}
export const enquote = (text) => `"${text}"`;
export function uniq(values, keygen) {
    const cache = new Set();
    return values.filter(value => {
        const key = keygen(value);
        if (cache.has(key))
            return false;
        cache.add(key);
        return true;
    });
}
